import React,{useEffect, useState} from 'react';
import './App.css';
import {requestToAPI} from './containers/API'



function App() {

  const [result,setResult] = useState([]);

  useEffect(()=>{
    requestToAPI().then((result)=>{
      setResult(result);
      console.log(result.items[0]);
    })
  },[]);


  return (
    <div className="App">
      <header className="App-header">

      </header>
      {result.items((item)=>{
        return <div>{item.isnew}</div>
      })}
    </div>
  );
}

export default App;
